The API is designed around two traits, the first looks roughly like /// A curve-agnostic trait for a BDFG commitment scheme *without precomputation*
pub trait PolyMultiProofNoPrecomp<E: Pairing>: Sized { /// The output proof type type Proof: Clone; /// Creates a proof of the given polynomials and evals at the given points fn open( &self, transcript: &mut Transcript, evals: &[impl AsRef<[E::ScalarField]>], polys: &[impl AsRef<[E::ScalarField]>], points: &[E::ScalarField], ) -> Result<Self::Proof, Error>; /// Verifies a proof against the given set of commitments and points fn verify( &self, transcript: &mut Transcript, commits: &[Commitment<E>], points: &[E::ScalarField], evals: &[impl AsRef<[E::ScalarField]>], proof: &Self::Proof, ) -> Result<bool, Error>;
} This takes a Merlin transcript for the Fiat-Shamir transform, some points xj​, some polynomials fi​ and the evaluations of each polynomial at each point fi​(xj​). This API is the most flexible, but not the most efficient. The second trait is more efficient, but requires knowledge of which points are being opened to beforehand. /// A curve-agnostic trait for a BDFG commitment scheme *with precomputation*
pub trait PolyMultiProof<E: Pairing>: Sized { /// The output proof type type Proof: Clone; /// Creates a of the given polynomials at the given point set index fn open( &self, transcript: &mut Transcript, evals: &[impl AsRef<[E::ScalarField]>], polys: &[impl AsRef<[E::ScalarField]>], point_set_index: usize, ) -> Result<Self::Proof, Error>; /// Verifies a proof against the given set of commitments and points fn verify( &self, transcript: &mut Transcript, commits: &[Commitment<E>], point_set_index: usize, evals: &[impl AsRef<[E::ScalarField]>], proof: &Self::Proof, ) -> Result<bool, Error>;
} When creating this object, there will be some way to specify the points, or they will be predetermined by the implementation. The API is largely the same.
